import React from 'react';
import { Carousel } from 'react-bootstrap';
import imageone from '../images/imageone.jpg';
import imagetwo from '../images/imagetwo.jpg';
import imagethree from '../images/imagethree.jpg';

class BodyCarousel extends React.Component {
  render() {
    return (
      <Carousel>
        <Carousel.Item style={{ height: 'calc(100vh - 111px)' }}>
          <img className="d-block w-100" src={imageone} alt="First slide" />
          <Carousel.Caption>
            <h3>First slide label</h3>
            <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item style={{ height: 'calc(100vh - 111px)' }}>
          <img className="d-block w-100" src={imagetwo} alt="Third slide" />

          <Carousel.Caption>
            <h3>Second slide label</h3>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          </Carousel.Caption>
        </Carousel.Item>
        <Carousel.Item style={{ height: 'calc(100vh - 111px)' }}>
          <img className="d-block w-100" src={imagethree} alt="Third slide" />

          <Carousel.Caption>
            <h3>Third slide label</h3>
            <p>
              Praesent commodo cursus magna, vel scelerisque nisl consectetur.
            </p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>
    );
  }
}

export default BodyCarousel;

